import React from "react";
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
// import {LogoHeader} from "../assets/Logo_Header";
import Comp1 from "./Componente1"
import Contact from "./Contact"
function Navbar(){
    /* eslint-disable */
    return(
        <Router>
        <div>
          {/* Crea una barra de navegación básica con enlaces a las diferentes páginas */}
          <nav>
            <ul>
              <li>
                <Link to="/">Inicio</Link>
              </li>
              <li>
                <Link to="/about">Acerca de</Link>
              </li>
              <li>
                <Link to="/contact">Contacto</Link>
              </li>
            </ul>
          </nav>
  
          {/* Define las rutas y los componentes a mostrar */}
          <Routes>
            <Route path="/" element={<Comp1/>} />
            <Route path="/contact" element={<ContactF/>} />
          </Routes>
        </div>
      </Router>
    );
};

export default Navbar;
